import React from 'react';

const Navbar = () => {
    return (
        <nav className="menu">
            <h3 className='name-sm'>Rodiyah</h3>
            <h3 className='name-md'>Rodiyah Ipaye</h3>
            <ul className="flex justify-between pl-8 h-[30px]">
                <li>
                    <a href="#about" className="text-black no-underline pl-2 mr-5 text-sm">About</a>
                </li>
                <li>
                    <a href="#projects" className="text-black no-underline pl-2 mr-5 text-sm">Projects</a>
                </li>
                <li>
                    <a href="#contact" className="text-black no-underline pl-2 mr-5 text-sm">Contact</a>
                </li>
            </ul>
        </nav>
    );
};

export default Navbar;
